import React from 'react'
import { ListGroup } from 'react-bootstrap'
import './Sidebar.css'
function Sidebar() {
  const rooms = ['HTML/CSS','JAVASCRIPT','PHP','PYTHON'];
  return (
    <div id="con">
      <br />
      <h2>Avalaible Rooms</h2>
      <ListGroup>
        {rooms.map((room, idx) => (
          <ListGroup.Item key={idx}>{room}</ListGroup.Item>
        ))}
        <ListGroup.Item>room</ListGroup.Item>
      </ListGroup>
      <h2>Members</h2>
    </div>
  );
}

export default Sidebar
